import React from "react";
import Navbar from "./Navbar";
import "./About.css";


const About = () => {
  return (
    <>
      {/* Hero Section */}
      <section className="hero">
        <header id="header">
          <a id="logo" href="/">Arc Deepa</a>
          <nav>
            <a id="menu-icon">&#8801;</a>
          </nav>
        </header>
        <header className="hero-header">
          <h1 className="hero-title">Deepa Devangmath</h1>
          <p className="hero-subtitle">Architect | Urban Designer | Interior Specialist</p>
        </header>
        <footer className="hero-footer">
          <a className="button button-primary" href="#introduction">Introduction</a>
          <a className="button" href="#contact">Contact</a>
        </footer>
      </section>

      {/* Main Content */}
      <article id="introduction">
        <h2>Introduction</h2>
        <p>
          Hi, I am a licensed architect with a passion for creating meaningful architectural solutions.
          My focus lies in crafting environments that resonate with human behavior and well-being.
        </p>
        <p>
          With extensive experience collaborating on live projects, I am eager to design spaces
          that balance context, creativity, and functionality.
        </p>
      </article>
    </>
  );
};

export default About;
